import React from "react";

export default function About() {
  return (
    <div className="flex flex-col text-center space-y-8 p-8">
      <h3 className="text-center text-xl">About</h3>
      <h1 className="font-serif">Building Websites using modern tech!</h1>
    </div>
  );
}
